  false,\n\t\"url\": null,\n\t\"notes\": \"The Barrow Area Information Database -
  Internet Map Server (BAID-IMS) is designed to help scientists, land managers, educators
  and the local community access spatially relevent information for northern Alaska.
  In addition to hosting information on current and historical research sites and
  infrastructure, BAID-IMS provides free access to satellite imagery and other remote
  sensing products, topographic maps, land ownership information and local infrastructure
  that facilitates research and science communication. We welcome ideas for how we
  can develop BAID-IMS to better suit the emerging needs of our user community.\",\n\t\"license_title\":
